import React  from 'react';
import styled from 'styled-components';


const MainContectSection=styled.div`
width           : 100%;
height          : 80vh;
background-color: whitesmoke;
`;

const Cards=styled.div`
width: 100%;
height: 15vh;
background-color: violet;
margin-top: 7%;
`;

const SmallCards=styled.div`
 width: 300px;
 background-color: whitesmoke;
 height: 150px;
 margin-left: 20px;
 margin-top: 20px;
`;
const Contact = () => {
    return (
       
<MainContectSection>
         <Cards>
         <div class = "container">
         <div class = "row">
         <div class = "col-sm">
             <SmallCards>

             </SmallCards>
         </div>
        <div class = "col-sm">
            <SmallCards>

            </SmallCards>
        </div>
        <div class = "col-sm">
            <SmallCards>

            </SmallCards>
        </div>
        </div>
        </div>
         </Cards>
</MainContectSection>
    )
}

export default Contact
